<div class=""col-md-12 conten_border mt-3 bor"">
    <div>
        <h2 style=""text-align:center; color:red; font-weight:bold"">Introduction to Jame</h2>
        <div style=""display: flex;
            align-items: center;
            justify-content: center;"">
            <img src=""https://p2d7x8x2.stackpathcdn.com/wordpress/wp-content/uploads/2015/09/Gordon_Ramsay-350x350.jpg"" alt=""Alternate Text"" />
        </div>
        <div style=""text-align:center; font-weight:bold"" class=""mt-2"">
            <p> Name: Born	Gordon James Ramsay Jr.</p>
            <p> Birthday: 8 November 1966 (age 52)</p> 
            <p> Address: Johnstone, Renfrewshire, Scotland</p>
            <p>  Spouse(s)	Tana Hutcheson (m. 1996)</p>
            <p>    Children	4, including Matilda</p>
            <p>  Culinary career</p>
            <p> Cooking style	French, Italian, British</p>
        </div>
        <div>
            <p style=""text-indent:20px"">Gordon James ");
            WriteLiteral(@"Ramsay Jr. OBE (born 8 November 1966) is a British chef, restaurateur, author and television personality. Born in Johnstone, Scotland and raised in Stratford-upon-Avon, England, Ramsay's restaurants have been awarded 16 Michelin stars in total and currently hold a total of 7.[1][2][3] His signature restaurant, Restaurant Gordon Ramsay in Chelsea, London, has held three Michelin stars since 2001. First appearing on television in the UK in the late 1990s, by 2004 Ramsay had become one of the best-known and most influential chefs in British popular culture.[4][5]</p>
            <p style=""text-indent:20px"">As a reality television personality, Ramsay is known for his fiery temper, strict demeanour, and frequent use of expletives. He often makes blunt and controversial comments, including insults and wisecracks about contestants' cooking and restaurant facilities. He combines activities in the television, film, hospitality, and food industries and has promoted and hired various chefs who have apprenticed under hi");
            WriteLiteral(@"s wing. Ramsay is known for presenting TV programmes about competitive cookery and food, such as the British series Hell's Kitchen, The F Word, and Ramsay's Kitchen Nightmares, the American series MasterChef, MasterChef Junior, and Hotel Hell, and the American versions of Hell's Kitchen and Kitchen Nightmares. In 2015, Forbes listed his earnings at $60 million for the previous 12 months, and ranked him the 21st highest earning celebrity in the world.[6]</p>

            <h3 style=""color:red""> Early life</h3>
            <p style=""text-indent:20px"">
                Ramsay was born on 8 November 1966[7] in Johnstone, Renfrewshire.[8] From the age of five, he was raised in Stratford-upon-Avon.[8] Ramsay is the second of four children. He has an older sister, Diane; a younger brother, Ronnie, who Ramsay revealed had been imprisoned for heroin possession as a juvenile;[9] and a younger sister, Yvonne. Ramsay's father, Gordon James Sr.,[10] was—at various times—a swimming pool manager, a welder, and a shopkeepe");
            WriteLiteral(@"r; his sister Yvonne and their mother, Helen (née Cosgrove),[10] have been nurses.[11]

                Ramsay has described his early life as ""hopelessly itinerant"" and said his family moved constantly due to the aspirations and failures of his father, who was a sometimes violent alcoholic.[10] In 1976, they finally settled in Stratford-upon-Avon, where he grew up in the Bishopton area of the town.[9] In his autobiography, Humble Pie, he describes his early life as being marked by abuse and neglect from this ""hard-drinking womaniser"".[11][12] At the age of 16, Ramsay moved out of the family home and into a flat in Banbury.[13]
            </p>
            <h3 style=""color:red""> Rangers revisited</h3>
            <p style=""text-indent:20px""> In series 4, episode 12 of The F Word (originally aired on 29 July 2008), Ramsay visited Ibrox, the home ground of his favourite childhood team, Rangers, and exclaimed, ""Home, Sweet Home!"" He explained, ""My dream came true when I was spotted in the mid-80s and I join");
            WriteLiteral(@"ed the youth team here in Ibrox."" He related that one of his fondest memories is playing alongside one of Scotland's football legends, Ally McCoist, who said about Ramsay, ""I remember him well and the one thing that never ever will change is that he's a competitive so-and-so and wants to do and be the best that he can."" Ramsay recalled that, ""the pain of being released on the back of an injury"" was only assuaged many years later, ""after receiving [his] third Michelin Star"", and concluded that, ""without the upset at Ibrox, I would not be the chef I am today.""[19]</p>
